import React from "react";
import FullScreenDialog from "../../Components/Dialogo";
import { TextField } from "@mui/material";
import './style.css'
const Inicial =()=> {

    return(
        <>
            <div className="container">
                <h4 className="usuario"> Usuário:Roberto Eder </h4>
                <h4 className="filial">Filial: PAGUE MENOS - SP </h4>
                <div className="aberturaSoli">
                    <h5 >Abertura da Solicitação</h5>
                        <FullScreenDialog />
                </div>
                <div className="acompanharSoli">
                    <h5 >Acompanhar Solicitação</h5>
                    <TextField onChange={handleInputChange} sx={{ m:1}}id="outlined-basic" label="Cod. Filial" variant="outlined" />
                </div>

            </div>
        </>

    );
}

export default Inicial;
